constexpr int16_t row_size = 16*160*2;
constexpr uint8_t rows = 128/16;

void menuInit()
{
  for (uint8_t row = 0; row < rows; row++)
  {
    uint16_t * buffer = row % 2 == 0 ? buffer1 : buffer2;
    
    memcpy(buffer, TITLE_IMAGE[row], row_size);
    
    if (row != 0) waitForPreviousDraw();
    
    drawScreenSlice(row * 16, 16, buffer);
  }

  waitForPreviousDraw();
}

void menuTick()
{
  if (gb.buttons.pressed(BUTTON_A))
  {
    startLevel(0);
    CURRENT_SCREEN = GAME_SCREEN;
  }

  if ((gb.frameCount >> 6) % 2)
  {
    memcpy(buffer1, PRESS_A[0], row_size);
    drawScreenSlice(6 * 16, 16, buffer1);
    waitForPreviousDraw();

    memcpy(buffer2, PRESS_A[1], row_size);
    drawScreenSlice(7 * 16, 16, buffer2);
    waitForPreviousDraw();
  }
  else
  {
    memcpy(buffer1, TITLE_IMAGE[6], row_size);
    drawScreenSlice(6 * 16, 16, buffer1);
    waitForPreviousDraw();

    memcpy(buffer2, TITLE_IMAGE[7], row_size);
    drawScreenSlice(7 * 16, 16, buffer2);
    waitForPreviousDraw();
  }
}
